import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {

  state = {
    products: [
      {
        id: 1,
        name: 'Potato',
        value: 0,
        price: 5
      },
      {
        id: 2,
        name: 'Tomato',
        value: 0,
        price: 3
      },
      {
        id: 3,
        name: 'Onions',
        value: 0,
        price: 2
      }
    ]
  }
  render() {
    return (
      <div className="App">
        <h1>Shopping App</h1>
      </div>
    )
  }
}

export default App;
